import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart is empty
    const cartCount = await page.textContent('.cart');
    if (cartCount && parseInt(cartCount) === 0) {
      // Add an item to cart first
      await page.waitForSelector('.product-card');
      await page.click('.product-card:first-child');

      await page.waitForSelector('#productModal');
      await page.click('.add-to-cart.large');
      await page.waitForTimeout(1000);

      await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Remove item from cart
    await page.waitForSelector('.remove-item');
    await page.click('.remove-item:first-child');

    // Wait for cart to update
    await page.waitForTimeout(1000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // Verify removal by checking cart count
    const updatedCartCount = await page.textContent('.cart');
    const extractedData = {
      initialCartCount: cartCount,
      finalCartCount: updatedCartCount,
      itemRemoved: parseInt(cartCount) > parseInt(updatedCartCount)
    };

    return {
      success: true,
      action: "Removed item from cart",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
